import React from 'react';
import '.././style/App.css';
import Sample from '.././feed/sample.json';

function Movies({}){
  return (
    <div>
      { Sample ? Sample.map(post => {
        return (
          <div key={post.id}>
            {post.entries[5]}

          </div>
        )
      }) : null}

    </div>
  );
}

export default Movies;
